import React from 'react';
import {PanelHeader, Group, List, Cell } from '@vkontakte/vkui';

function ViewPanel ({Plus, ...props}) {
    console.log(Plus);
  return (
    <>
      <PanelHeader addon={Plus} left={Plus}>Каталог</PanelHeader>
      <Group title="Items">
          <List>
          <Cell>Hello</Cell>
          <Cell>World</Cell>
          </List>
      </Group>
    </>
  );
}

export default ViewPanel;
